import React, { Component } from "react";
import {
    InstantSearch,
    Configure,
    Hits,
    SearchBox,
    Pagination,
    Highlight
} from "react-instantsearch/dom";
import PropTypes from "prop-types";

class Test extends Component {
    render() {
        return (
            <InstantSearch
                appId="XJAGT21XS0"
                apiKey="54a973d94697a6de6b319d890639c9ca"
                indexName="Test">
                <Configure hitsPerPage={8} />

                <div className="container">
                    <h2> Products </h2>
                    <SearchBox />
                    <div className="twoColumns" >
                        <Hits hitComponent={Hit} />
                    </div>
                    <div style={{ textAlign: "center" }} >
                        <Pagination />
                    </div>
                </div>
            </InstantSearch>
        );
    }
}

function Hit(props) {
    return (
        <div>
            <Highlight attributeName="name"
                hit={props.hit} />
        </div>
    );
}

Hit.propTypes = {
    hit: PropTypes.arrayOf(PropTypes.object).isRequired
};

export default Test;
